import {plantList} from "./datas/planlist";

function shoppingList(){
    return(
        <ul>
           {plantList.map((plant) => (
            <li key={plant.id}>
                {
                `${plant.category}: ${plant.name}`
                }</li>
           ))} 
        </ul>
    )
}
console.log(plant);

export default shoppingList
